import React, { useState, useEffect, useRef } from 'react';
import {
  StyleSheet,
  Text,
  View,
  TouchableOpacity,
  Dimensions,
  Animated,
} from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import * as Haptics from 'expo-haptics';

const { width, height } = Dimensions.get('window');

export default function GameScreen({ onGameEnd }) {
  const [score, setScore] = useState(0);
  const [timeLeft, setTimeLeft] = useState(30);
  const [circles, setCircles] = useState([]);
  const [gameActive, setGameActive] = useState(true);
  const [nextId, setNextId] = useState(0);

  const gameTimer = useRef(null);
  const circleTimer = useRef(null);

  useEffect(() => {
    startGame();
    return () => {
      if (gameTimer.current) clearInterval(gameTimer.current);
      if (circleTimer.current) clearInterval(circleTimer.current);
    };
  }, []);

  useEffect(() => {
    if (timeLeft <= 0) {
      endGame();
    }
  }, [timeLeft]);

  const startGame = () => {
    // Game countdown timer
    gameTimer.current = setInterval(() => {
      setTimeLeft(prev => prev - 1);
    }, 1000);

    // Circle spawning timer
    spawnCircle();
    circleTimer.current = setInterval(() => {
      spawnCircle();
    }, 1500);
  };

  const spawnCircle = () => {
    const newCircle = {
      id: nextId,
      x: Math.random() * (width - 80) + 40,
      y: Math.random() * (height - 200) + 100,
      scale: new Animated.Value(0),
      opacity: new Animated.Value(1),
    };

    setNextId(prev => prev + 1);
    setCircles(prev => [...prev, newCircle]);

    // Animate circle appearance
    Animated.spring(newCircle.scale, {
      toValue: 1,
      tension: 100,
      friction: 8,
      useNativeDriver: true,
    }).start();

    // Remove circle after 3 seconds if not tapped
    setTimeout(() => {
      removeCircle(newCircle.id);
    }, 3000);
  };

  const removeCircle = (id) => {
    setCircles(prev => prev.filter(circle => circle.id !== id));
  };

  const tapCircle = (circle) => {
    if (!gameActive) return;

    Haptics.impactAsync(Haptics.ImpactFeedbackStyle.Light);
    setScore(prev => prev + 10);

    // Animate circle disappearance
    Animated.parallel([
      Animated.timing(circle.scale, {
        toValue: 1.5,
        duration: 150,
        useNativeDriver: true,
      }),
      Animated.timing(circle.opacity, {
        toValue: 0,
        duration: 150,
        useNativeDriver: true,
      }),
    ]).start(() => {
      removeCircle(circle.id);
    });
  };

  const endGame = () => {
    setGameActive(false);
    if (gameTimer.current) clearInterval(gameTimer.current);
    if (circleTimer.current) clearInterval(circleTimer.current);

    Haptics.impactAsync(Haptics.ImpactFeedbackStyle.Heavy);

    setTimeout(() => {
      onGameEnd(score);
    }, 1500);
  };

  return (
    <LinearGradient
      colors={['#667eea', '#764ba2']}
      style={styles.container}
    >
      {/* Game UI */}
      <View style={styles.gameUI}>
        <View style={styles.scoreContainer}>
          <Text style={styles.scoreText}>Score: {score}</Text>
        </View>
        <View style={styles.timerContainer}>
          <Text style={styles.timerText}>{timeLeft}s</Text>
        </View>
      </View>

      {/* Game Area */}
      <View style={styles.gameArea}>
        {circles.map(circle => (
          <Animated.View
            key={circle.id}
            style={[
              styles.circle,
              {
                left: circle.x,
                top: circle.y,
                transform: [{ scale: circle.scale }],
                opacity: circle.opacity,
              },
            ]}
          >
            <TouchableOpacity
              style={styles.circleButton}
              onPress={() => tapCircle(circle)}
              activeOpacity={0.8}
            >
              <LinearGradient
                colors={['#ff6b6b', '#ee5a24']}
                style={styles.circleGradient}
              />
            </TouchableOpacity>
          </Animated.View>
        ))}
      </View>

      {/* Game Over Overlay */}
      {!gameActive && (
        <View style={styles.gameOverOverlay}>
          <View style={styles.gameOverContainer}>
            <Text style={styles.gameOverText}>Game Over!</Text>
            <Text style={styles.finalScoreText}>Final Score: {score}</Text>
            <Text style={styles.returningText}>Returning to home...</Text>
          </View>
        </View>
      )}
    </LinearGradient>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  gameUI: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    paddingHorizontal: 20,
    paddingTop: 20,
    paddingBottom: 10,
  },
  scoreContainer: {
    backgroundColor: 'rgba(255, 255, 255, 0.2)',
    paddingHorizontal: 20,
    paddingVertical: 10,
    borderRadius: 20,
  },
  scoreText: {
    color: '#fff',
    fontSize: 18,
    fontWeight: '700',
  },
  timerContainer: {
    backgroundColor: 'rgba(255, 255, 255, 0.2)',
    paddingHorizontal: 20,
    paddingVertical: 10,
    borderRadius: 20,
  },
  timerText: {
    color: '#fff',
    fontSize: 18,
    fontWeight: '700',
  },
  gameArea: {
    flex: 1,
    position: 'relative',
  },
  circle: {
    position: 'absolute',
    width: 80,
    height: 80,
  },
  circleButton: {
    width: '100%',
    height: '100%',
  },
  circleGradient: {
    width: '100%',
    height: '100%',
    borderRadius: 40,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 4 },
    shadowOpacity: 0.3,
    shadowRadius: 8,
    elevation: 8,
  },
  gameOverOverlay: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: 'rgba(0, 0, 0, 0.8)',
    justifyContent: 'center',
    alignItems: 'center',
  },
  gameOverContainer: {
    backgroundColor: 'rgba(255, 255, 255, 0.1)',
    padding: 40,
    borderRadius: 20,
    alignItems: 'center',
    backdropFilter: 'blur(10px)',
  },
  gameOverText: {
    color: '#fff',
    fontSize: 32,
    fontWeight: '800',
    marginBottom: 20,
  },
  finalScoreText: {
    color: '#fff',
    fontSize: 24,
    fontWeight: '600',
    marginBottom: 10,
  },
  returningText: {
    color: '#fff',
    fontSize: 16,
    opacity: 0.8,
  },
});
